INSERT INTO `apiCode` VALUES ('39', ' public static Cipher getAESCipher (int mode, byte[] key)\r\n    {\r\n        try {\r\n            Cipher cipher = Cipher.getInstance(\"AES/CBC/PKCS5Padding\");\r\n            SecretKeySpec aesKey = new SecretKeySpec(key, \"AES\");\r\n            cipher.init(mode, aesKey, IVPS);\r\n            return cipher;\r\n        } catch (GeneralSecurityException gse) {\r\n            log.warning(\"Failed to create cipher\", gse);\r\n        }\r\n        return null;\r\n    }\r\n', '8', 'https://github.com/threerings/narya/blob/a7e0893191b56381e37740de4a639e696a368881/core/src/main/java/com/threerings/presents/util/SecureUtil.java');
