INSERT INTO `apiCode` VALUES ('326', 'private final Map/*<K,ReentrantLock>*/ locks;\r\npublic void writeLock(final Object key) {\r\n        ReentrantLock lock;\r\n        synchronized (locks) {\r\n            lock = (ReentrantLock) locks.get(key);\r\n            if (lock == null) {\r\n                lock = new ReentrantLock();\r\n                locks.put(key, lock);\r\n            }\r\n        }\r\n        lock.lock();        \r\n    }', '66', 'https://github.com/Geocent/NetCDFPlugin/blob/53610b9abcba1d287365f49bd26950f68317864d/geotools-12.0/modules/library/metadata/src/main/java/org/geotools/util/FixedSizeObjectCache.java');
INSERT INTO `apiCode` VALUES ('327', 'private final Map<K,Object> hash = new HashMap<K,Object>();\r\npublic int size() {\r\n        synchronized (hash) {\r\n            return hash.size();\r\n        }\r\n    }', '66', 'https://github.com/Geocent/NetCDFPlugin/blob/53610b9abcba1d287365f49bd26950f68317864d/geotools-12.0/modules/library/metadata/src/main/java/org/geotools/util/SoftValueHashMap.java');
INSERT INTO `apiCode` VALUES ('328', 'private final Map/*<K,ReentrantLock>*/ locks;\r\npublic void writeUnLock(final Object key) {\r\n        synchronized (locks) {\r\n            final ReentrantLock lock = (ReentrantLock) locks.get(key);\r\n            if (lock == null) {\r\n                throw new IllegalMonitorStateException(\"Cannot unlock prior to locking\");\r\n            }\r\n            if( lock.getHoldCount() == 0 ){\r\n                throw new IllegalMonitorStateException(\"Cannot unlock prior to locking\");\r\n            }\r\n            lock.unlock();\r\n            if (lock.getHoldCount() == 0) {\r\n                locks.remove(key);\r\n            }\r\n        }\r\n    }', '66', 'https://github.com/Geocent/NetCDFPlugin/blob/53610b9abcba1d287365f49bd26950f68317864d/geotools-12.0/modules/library/metadata/src/main/java/org/geotools/util/FixedSizeObjectCache.java');
INSERT INTO `apiCode` VALUES ('329', 'private final Map/*<K,ReentrantLock>*/ locks;\r\nboolean holdsLock(final Object key) {\r\n        synchronized (locks) {\r\n            final ReentrantLock lock = (ReentrantLock) locks.get(key);\r\n            if (lock != null) {\r\n                return lock.getHoldCount() != 0;\r\n            }\r\n        }\r\n        return false;\r\n    }', '66', 'https://github.com/Geocent/NetCDFPlugin/blob/53610b9abcba1d287365f49bd26950f68317864d/geotools-12.0/modules/library/metadata/src/main/java/org/geotools/util/FixedSizeObjectCache.java');
INSERT INTO `apiCode` VALUES ('330', 'private final Map/*<K,ReentrantLock>*/ locks;\r\npublic void remove(Object key){\r\n    	synchronized (locks) {\r\n    		locks.remove(key);\r\n		}\r\n    }', '66', 'https://github.com/Geocent/NetCDFPlugin/blob/53610b9abcba1d287365f49bd26950f68317864d/geotools-12.0/modules/library/metadata/src/main/java/org/geotools/util/FixedSizeObjectCache.java');
